<!doctype html>
<html class="no-js">
<head>
	<meta charset="utf-8">
	<title>Maintenance</title>
	<meta name="viewport" content="width=device-width, initial-scale=1, minimum-scale=1, maximum-scale=1, shrink-to-fit=no">
	<link rel="icon" type="image/png" sizes="32x32" href="data:image/png;base64,">

    <script>
        document.addEventListener('DOMContentLoaded', function() {
            // Détecte la langue du navigateur
            var userLang = navigator.language || navigator.userLanguage;

            // Textes en français et anglais
            var content = {
                fr: {
                    title: "Maintenance en cours",
                    paragraph1: "Notre site fait actuellement l’objet d’une maintenance et de mises à jour programmées, mais nous revenons très vite !",
                    paragraph2: "Merci de votre patience"
                },
                en: {
                    title: "Maintenance in progress",
                    paragraph1: "Our site is currently undergoing maintenance and scheduled updates, but we will be back soon!",
                    paragraph2: "Thank you for your patience"
                }
            };

            // Si la langue est le français (ou une variante), affiche le contenu en français, sinon en anglais
            var selectedLang = userLang.startsWith('fr') ? 'fr' : 'en';

            // Modifie le contenu de la page en fonction de la langue
            document.getElementById('title').textContent = content[selectedLang].title;
            document.getElementById('paragraph1').textContent = content[selectedLang].paragraph1;
            document.getElementById('paragraph2').textContent = content[selectedLang].paragraph2;
        });
    </script>
	<style>
        html, body {
            padding: 0;
            margin: 0;
            width: 100%;
            height: 100%;
        }

        * {
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
            text-align: center;
            font-size: 1rem;
            background: rgba(207, 214, 232, .4);
            color: #072360;
            display: flex;
            align-items: center;
            justify-content: center;
            min-height: 850px;
        }

        main {
            max-width: 800px;
            padding: 3rem 2rem;
            margin: 0 auto;
        }

        h1 {
            font-weight: 500;
            font-size: 3rem;
            margin: 4rem 0 2rem;
        }

        p {
            font-size: 1.5rem;
            font-weight: 300;
            line-height: 1.5;
        }

        p + p {
            margin-top: 2.5rem;
            font-weight: 500;
        }

        svg {
            max-width: 600px;
        }

        .credit {
            position: absolute;
            bottom: 1rem;
            right: 1rem;
            margin-top: .5rem;
            font-size: .7rem;
            color: #b8c3d8;
        }

        @media screen and (max-width: 600px) {
            body {
                min-height: 650px;
            }

            h1 {
                font-size: 2.5rem;
                margin: 3rem 0 1.5rem;
            }

            p {
                font-size: 1.2rem;
            }

            p + p {
                margin-top: 2rem;
            }
        }
	</style>
</head>
